export default (function(a,b,c,d,e,f){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:d,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:d,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:e,pageSize:25,pageCount:e,total:5}}},exEhIMSVBo:{data:{id:1862,attributes:{imdbId:"tt0088323",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BM2YwNWExYjItODZmOC00MTRjLWFlYmEtODFmNGI5M2E5NzYxXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"7.4\u002F10"},{Source:"Rotten Tomatoes",Value:"80%"},{Source:"Metacritic",Value:"46\u002F100"}],item_lang:{data:{id:2525,attributes:{title:"The NeverEnding Story",plot:"Bastian is a young boy who lives a dreary life being tormented by school bullies. On one such occasion he escapes into a book shop where the old proprieter reveals an ancient story-book to him, which he is warned can be dangerous. Shortly after, he \"borrows\" the book and begins to read it in the school attic where he is drawn into the mythical land of Fantasia, which desperately needs a hero to save it from destruction.",slug:"the-neverending-story"}}},books:{data:[{id:9444,attributes:{title:"Die unendliche Geschichte",description:"Bastian lernt das geheimnisvolle Land Phant sien kennen und findet beinahe nicht wieder zurück.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=_7IKAQAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[f],firstBook:true,published:"1979-01-01",publisher:a,subtitle:"von A bis Z"}},{id:9445,attributes:{title:"The Neverending Story",description:"Read the book that inspired the classic coming-of-age film before it's back onscreen in select theaters this September! From award-winning German author Michael Ende, The Neverending Story is a classic tale of one boy and the book that magically comes to life. When Bastian happens upon an old book called The Neverending Story, he's swept into the magical world of Fantastica--so much that he finds he has actually become a character in the story! And when he realizes that this mysteriously enchanted world is in great danger, he also discovers that he is the one chosen to save it. Can Bastian overcome the barrier between reality and his imagination in order to save Fantastica? \"An instantaneous leap into the magical . . . Energetic, innovative, and perceptive\"—The Washington Post \"A trumpet blast for the imagination.\"—Sunday Times",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=KuFwDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[f],firstBook:c,published:"1993-01-01",publisher:"Penguin",subtitle:a}},{id:9446,attributes:{title:"Na Klar! 2 Student's Book (Higher)",description:"Don't let them drop German! A major growing concern in schools is the decline in the number of language students and the impact this could have on your department. Which is why we've developed Na klar! - the only course to captivate all your students and help keep German alive in your school!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=w6QVR8ezZp8C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Michael Spencer","Alan Wesson"],firstBook:c,published:"2005-01-01",publisher:"Nelson Thornes",subtitle:a}},{id:9447,attributes:{title:"The Babel Guide to German Fiction in English Translation",description:"The Babel Guide is a new way in to the excitement of world fiction with lively original reviews and excerpts of the best books by the writers of Austria, Germany and Switzerland. It includes full listings of all translations published since 1950. A unique introduction to the wealth of fiction in translation. Babel Guides is a new series on contemporary world fiction in English. The Reviews introduce the best, most representative books, with a quotation as a taster. The Database gives useful details on fiction.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=W_BbAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Ray Keenoy","Michael Mitchell","Maren Meinhardt"],firstBook:c,published:"1997-01-01",publisher:a,subtitle:"Austria, Germany, Switzerland"}},{id:9448,attributes:{title:"The Oxford Companion to Children's Literature",description:"The last thirty years have witnessed one of the most fertile periods in the history of children's books. A fascinating reference guide to the world of children's literature, this volume covers every genre from fairy tales to chapbooks; school stories to science fiction; comics to children's hymns",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Mb66BwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Daniel Hahn"],firstBook:c,published:"2015-03-26",publisher:"Oxford University Press, USA",subtitle:a}}]}}},meta:{}}},prerenderedAt:1681703537210}}("","movie",null,"series",1,"Michael Ende"))